import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";  // Import routing components
import JobApplicationList from "./components/JobApplicationList";  // Import your component
import AddJobApplication from "./components/AddJobApplication";
import EditJobStatus from "./components/EditJobStatus"; 


const App: React.FC = () => {
  return (
    <Router>  {/* Wrap your app with Router */}
      <div className="App">
        <h1>Job Application Tracker</h1>
        {/* Define the Routes */}
        <Routes>
          <Route path="/" element={<JobApplicationList />} /> {/* Default route */}
          <Route path="/add" element={<AddJobApplication />} /> {/* Default route */}
          <Route path="/edit/:jobId" element={<EditJobStatus />} /> {/* Add edit route */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
